import React from 'react'
import CatbarBTN from '../catbar/catbarBTN'

const CatBar = () => {
    return(
        <div className="catbar_div">
            <div className="catbar_category">
                <h1 style={category_test}>Movies</h1>
            </div>
            <div className="catbar_buttons">
                <CatbarBTN title="Action" />
            </div>
        </div>
    );
}

const category_test = {
    color: "white",
    fontSize: "30pt",
    textAlign: "center",
    margin: "0"
}

export default CatBar
